    result += cvor[16]*y[16]*imw[16]; /*HCO */
    result += cvor[17]*y[17]*imw[17]; /*CH2O */
    result += cvor[18]*y[18]*imw[18]; /*CH2OH */
    result += cvor[19]*y[19]*imw[19]; /*CH3O */
