    result += cvor[25]*y[25]*imw[25]; /*C2H5 */
    result += cvor[26]*y[26]*imw[26]; /*C2H6 */
    result += cvor[27]*y[27]*imw[27]; /*HCCO */
    result += cvor[28]*y[28]*imw[28]; /*CH2CO */
    result += cvor[29]*y[29]*imw[29]; /*HCCOH */
