        Kc_s[76*npt+i] = exp((g_RT[1*npt+i] + g_RT[16*npt+i]) - (g_RT[0*npt+i] + g_RT[14*npt+i]));
        Kc_s[77*npt+i] = exp((g_RT[1*npt+i] + g_RT[17*npt+i]) - (g_RT[0*npt+i] + g_RT[16*npt+i]));
