    /*reaction 216: HO2 + C3H7 => OH + C2H5 + CH2O */
    kc[215] = refC * exp((g_RT[6] + g_RT[31]) - (g_RT[4] + g_RT[25] + g_RT[17]));

    /*reaction 217: CH3 + C3H7 <=> 2 C2H5 */
    kc[216] = exp((g_RT[12] + g_RT[31]) - (2 * g_RT[25]));

